    const imageProperties = [{"image_details": "slide","image":"/images/web/web1.jpg","category":"web"},
                             {"image_details": "slide","image":"/images/web/web2.jpg","category":"web"},
                             {"image_details": "slide","image":"/images/web/web3.jpg","category":"web"},
                             {"image_details": "slide","image":"/images/mobile/mobile1.jpg","category":"mobile"},
                             {"image_details": "slide","image":"/images/mobile/mobile2.jpg","category":"mobile"},
                             {"image_details": "slide","image":"/images/mobile/mobile3.jpg","category":"mobile"},
