                             {"image_details": "slide","image":"/images/automation/automation2.jpg","category":"automation"}
                            ];
    const radioProperties = [{"id":"radio1","category":"web"},
                             {"id":"radio2","category":"web"},
                             {"id":"radio3","category":"web"},
                             {"id":"radio4","category":"mobile"},
                             {"id":"radio5","category":"mobile"},
                             {"id":"radio6","category":"mobile"},
                             {"id":"radio7","category":"automation"},
                             {"id":"radio8","category":"automation"}
                            ];

    return <div className={classes.ImageSlider}>
                <ImageSlider imageProperties={imageProperties}/>
                <RadioBtnSlider radioProperties={radioProperties}/> 
           </div>

}

export default whatwedo;
